import React, { Component } from "react";

export default class Cell extends Component {
  state = {
    // color: null,
    // cellNumber: null,
    // x: this.props.cell.i,
    // y: this.props.cell.j,
    // taken: false
  };

  componentDidMount() {
    console.log("meteor?", this.props.cell.type === "meteorite");

    this.setState({ cell: this.props.cell });
  }

  render() {
    return !this.state.cell ? (
      <p>yo</p>
    ) : (
      <div
        className={
          this.state.cell.type === "meteorite" ? "cell meteorite" : "cell"
        }
      />
    );
  }
}
